import React, { Component } from 'react';

class Header extends Component {
    render(){
        return (
            <div>
                <h1>Eleanor Rumsey Designs</h1>
                <i class="fab fa-github"></i>
                <i class="fab fa-linkedin"></i>
            </div>
        );
    }
}

export default Header;
